    return (
        <div style={{ backgroundColor: '#fff' }}>
        <Carousel>
            <div className={`${styles.carouselImg} ${styles.carouselImgAng}`}></div>
            <div className={`${styles.carouselImg} ${styles.carouselImgReact}`}></div>
            <div className={`${styles.carouselImg} ${styles.carouselImgVue}`}></div>
            <div className={`${styles.carouselImg} ${styles.carouselImgNode}`}></div>
            <div className={`${styles.carouselImg} ${styles.carouselImgDocker}`}></div>
            <div className={`${styles.carouselImg} ${styles.carouselImgMongo}`}></div>
            <div className={`${styles.carouselImg} ${styles.carouselImgPostgress}`}></div>
        </Carousel>
        </div>

    )
};

export default Technologies;
